import React from 'react';
import './App.css';
import { Link } from 'react-router-dom';
import{ Button, Form, FormGroup, Label, Input} from 'reactstrap';
import{ FacebookLoginButton } from 'react-social-login-buttons';

function principal() {
  return (
      <Form className="App">
      <h1><span>tufast</span>.com</h1>
      <h2 className="text-center">Bienvenido</h2>
      
        <Label>Email</Label>
        <Input type="Email" class="queso"/>
       
      
      <FormGroup>
        <Label>Password</Label>
        <Input type="Password" placeholder="Password"/> 
      </FormGroup>
      
      <Button onClick={()=>{}} className="btnlogin" >Ingresar</Button>
      <div className="xdrow">
      <a className="laviymeolvide"> Forgot Password</a>
        <a href="/registrarse"className="laviymeolvide"> Sign Up</a>
        
      
    
      </div>
 

    </Form>
  );
}
export default principal;
